// src/components/Header.js
import React from 'react';
import { Button, Space } from 'antd';



const Header = () => {
  return (
    <div style={{ padding: '16px', background: '#001529', color: 'white' }}>
      <Space>
        <Button type="primary">Login</Button>
        <Button>Logout</Button>
        <Button type="link">Profile</Button>

      <div class="floating-controls">
        <div class="form-input">
          <label for="region-select">Select a region:</label>
          <select id="region-select">
            <option value="">Select a region</option>
            <option value="United States">United States</option>
            <option value="India">India</option>
            <option value="United Kingdom">United Kingdom</option>
          </select>
          <button id="load-button">Load</button>
        </div>
        <div class="region-info-card" style="display: none;">
          <h3>Region Information</h3>
          <p id="region-info-text"></p>
        </div>
      </div>

      </Space>
    </div>
  );
};

export default Header;
